import melkamresize from '../assets/image/melkamresize.jpg';

const Tour = (props) => {


    return (
        <div class="container">
<div class="card testimonial-card">
  <div class="card-up indigo lighten-1"></div>
  <div class="avatar mx-auto white">
    <img src={melkamresize} class="rounded-circle" alt="Manager of TourEthiopia" />
  </div>

  <div class="card-body">
    <h4 class="card-title">Melkam Mekonnen</h4>
    <hr />

    <p><i class="fas fa-quote-left"></i>TourEthiopia provides the same outstanding, personalized service to our clients as before. Semien Mountains, majestic mountains, is the source of inspiration for delivering the best possible experience for touring Ethiopia that is possible. Come travel with us to see the beauty, the tradition, the majesty of Ethiopia.</p>
  </div>

</div>

        </div>
    );
}


export default Tour;
